import BodyWrapper from "./BodyWrapper";

const Body = () => {
  return (
      BodyWrapper>
    <div>
      <button className="btn btn-success add">
        <FontAwesomeIcon icon={faPlus} />
      </button>
    </div>
  );
};

export default Body;
